description:
Dave Distler aka rfmwguy on NasaSpaceFlight forums is an engineer, radio operator and aerospace consultant. He is interviewed in Richard C. Hoagland's 'The Other Side of Midnight', 13th August 2015, about the research done around the world on the EmDrive, a propellantless microwave resonant cavity thruster that may revolutionize both Earth and space travel.

Distler is introduced at 14:38 from the beginning of the show.
